const Match = (props) => {
  return (
    <>
      <tr>
        <td>{props.match.home}</td>
        <td>
          {props.match.home_score} - {props.match.away_score}
        </td>
        <td>{props.match.away}</td>
        <td>{props.match.result}</td>
      </tr>
    </>
  );
};

export default Match;
